function Card(props) {
  return (
    <div className="note">
      <h2>{props.name}</h2>
      <img src="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg" />

      <p> {props.telephone} </p>
      <p> {props.email}</p>
    </div>
  );
}

export default Card;
